// import external modules
import React, { Component } from "react";

import {
    ChevronRight, Edit,
    Settings, Trash2
} from "react-feather";
import { NavLink } from "react-router-dom";

// Styling
import "../../../../../assets/scss/components/sidebar/sidemenu/sidemenu.scss";
// import internal(own) modules
import SideMenu from "../sidemenuHelper";

class SideMenuContent extends Component {
   render() {
       console.log(this.props.pages)
      return (
         <SideMenu className="sidebar-content" toggleSidebarMenu={this.props.toggleSidebarMenu}>
            <SideMenu.MenuMultiItems
               name="Settings"
               Icon={<Settings size={18} />}
               ArrowRight={<ChevronRight size={16} />}
               collapsedSidebar={this.props.collapsedSidebar}
            >
                {this.props.page.map((value, index) =>
                    <tr key={index}>
                        {Object.keys(value).map((key) => <td key={key}>{value[key]}</td>)}
                        <td>
                            <Edit size={18} className="mr-2" onClick={() => toggle("edit",value['id'])}/>
                            <Trash2 size={18} color="#FF586B" onClick={() => toggle("delete",value['id'])}/>
                        </td>
                    </tr>
                )}
               <NavLink to="/users" className="item" activeclassname="active"  >
                  <span className="menu-item-text">Users</span>
               </NavLink>
                <NavLink to="/positions" className="item" activeclassname="active">
                    <span className="menu-item-text">Positions</span>
                </NavLink>
            </SideMenu.MenuMultiItems>
         </SideMenu>
      );
   }
}

export default SideMenuContent;
